import React, { useState } from "react";
import auth from "../../lib/api/auth";
import { DataTable, Button } from "react-native-paper";
import {  View } from "react-native";
import AsyncStorage from "@react-native-async-storage/async-storage";
import { set } from "lodash";
import { useNavigation } from "@react-navigation/native";
import { useFonts, Inter_900Black } from '@expo-google-fonts/inter';
import { TextInput } from "react-native-paper";






export default function EditTable() {
    const [title, setTitle] = useState("")
    const [courtName, setCourtName] = useState("")
    const [notes, setNotes] = useState("")
    const [category, setCategory] = useState("")
    const [nextHiring, setHiring] = useState("")
    const [startingDate, setStartingData] = useState("")
    const [stage, setStage] = useState("")
    const navigation = useNavigation();
    console.log("title: ", title)
    const AddNewCase = async () => {
        let id = await AsyncStorage.getItem("userId")
        const values = {
            id: JSON.parse(id),
            title: title,
            courtName: courtName,
            notes: notes,
            stage: stage,
            category: category,
            nextHiring: nextHiring,
            startingDate: startingDate,
        };
        const res = await auth.post("lawyer/addCase", values);
        navigation.goBack();
        console.log(res.status)
    }
    return (
        <>
            <View>
                <DataTable.Row style={{}}>
                    <DataTable.Cell style={{}}></DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setTitle(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="CaseTitle"  />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setCourtName(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                    //  
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="CourtName" />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setCategory(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                    fontSize: 15,
                                    letterSpacing: 1,

                                }}   placeholder="Category" />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setStage(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,

                                   
                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="Stage" />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setStartingData(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="Start/Prev Date" />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setHiring(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="Next Date" />
                        </View>
                    </DataTable.Cell>
                    <DataTable.Cell style={{}}>
                        <View>
                            <TextInput
                                onChangeText={text => setNotes(text)}
                                style={{
                                    backgroundColor: "#EEEEEE",
                                     
                                    height: 40,


                                    paddingLeft: 15,
                                    color: "#222222",
                                      
                                    fontSize: 15,
                                    fontWeight: "500",
                                    letterSpacing: 1,

                                }}   placeholder="Notes" />
                        </View>
                    </DataTable.Cell>
                </DataTable.Row>
                <View>
                    <Button
                        onPress={() => AddNewCase()}
                        color="#244e78"
                        style={{
                             width:'20%',
                            borderColor: "#244e78",
                            borderWidth: 1,
                            margin: 5,
                            padding: 5,
                            left: "50%"
                        }}
                    >
                        Submit
                    </Button>
                </View>
            </View>
        </>
    )
}
